import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const Navbar = styled.div`
	height: 55px;
	backround-color: white;
	display: flex;
	justify-content: space-between;
	align-items: center;
`;

const MainNav = styled.ul`
	list-style-type: none;
`;

const NavLink = styled.li`
	text-align: center;
	margin: 15px auto;
`;

const AccountNav = styled.div`
	min-height: 35px;
	width: 100%;
	background-color: #dedede;
	display: flex;
	justify-content: flex-end;
	align-items: center;
`;

const JoinUs = styled.p`
	margin: 0;
	margin-right: 10px;
	font-size: 0.8rem;
	height: 100%;
	&:hover {
		color: #595959;
	}
`;

const SignIn = styled.p`
	margin: 0px 20px 0px 10px;
	font-size: 0.8rem;
	height: 100%;
	&:hover {
		color: #595959;
	}
`;

function Nav() {
    return (
		<>	
			<Navbar>
				<Link style={{textDecoration: 'none', fontSize: '22px', color: 'black', cursor: 'pointer', marginLeft: '20px', fontWeight: '500', display: 'inline-block'}}>Sneaker Galore</Link>

				<MainNav>
					<NavLink>Home</NavLink>
					<NavLink>Featured Collections</NavLink>
					<NavLink>Shop</NavLink>
				</MainNav>


			</Navbar>

			<AccountNav>
				<Link
					style={{textDecoration: 'none', color: 'black', height: '100%'}}
				><JoinUs>Join Us</JoinUs></Link>
				|
				<Link
					style={{textDecoration: 'none', color: 'black'}}
				><SignIn>Sign In</SignIn></Link>
			</AccountNav>
		</>
    );
}

export default Nav;
